import React from "react";

class UserUI extends React.Component {
  state = {};
  render() {
    return (
      <div>
        <nav class="navbar navbar-default navbar-fixed-top">
          <div class="container">
            <a class="navbar-brand">Project name</a>
          </div>
        </nav>
      </div>
    );
  }
}

export default UserUI;
